import EMPNAV from "./empnav";
import Footer from "./footer";
import employeeDetails from "./smallComp/employeeDetails";

export class empIndex extends Component {
    constructor(props) {
        super(props);

        this.state = {
            username: '',
            password: '',
            isLogin: true,
            errors: {}
        }
    }
    render() {
        return (
            <div className="admin">
                <Header/>
                <EMPNAV/>
                <div className="admin__main">

                </div>
            <Footer/>
            </div>
        );
    }
}
